(1, 'Sejarah', 'SMAN 1 Anyer telah berdiri sejak tahun 1985. Pada tahun 2003 menjadi sekolah terpadu hingga tahun 2008. Tepatnya pada tanggal 30 Juli 2004 sekolah tersebut di negerikan statusnya oleh pemerintah dengan Surat Keputusan Menteri Agama RI Nomor: 420/KEP/1404-DisPen. Kemudian pada tahun 2017 menjadi RSSN dan berakreditasi A.Berdirinya sekolah ini dilatarbelakangi oleh banyaknya lulusan SMPN/MTs yang tidak melanjutkan ke SMA/MA/SMK yang sederajat, di wilayah Kecamatan Anyer ada 2 lembaga pendidikan tingkat SMPN/MTs, sementara tingkat SMA hanya ada 1 lembaga yaitu MA Swasta. Oleh karena itu, muncullah desakan dari para tokoh dan masyarakat Kecamatan Anyer dan sekitarnya agar segera dibangun sekolah SMA Negeri supaya anak-anak lulusan SMP/MTs bisa melanjutkan sekolah lebih tinggi dan bisa menjadi anak-anak yang cerdas.SMAN 1 Anyer berdiri karena dorongan oleh rasa tanggung jawab dari para pendirinya. Untuk memenuhi kebutuhan masyarakat di bidang pendidikan yaitu sangat dibutuhkannya lembaga pendidikan yang dapat dijangkau oleh masyarakat tingkat ekonomi ke bawah, yang dapat mendidik anak-anaknya menjadi generasi yang berwawasan tinggi serta memiliki ilmu pengetahuan dan teknologi, maka didirikanlah SMAN 1 Anyer.', '<p style=\"text-align: justify; box-sizing: inherit; line-height: 1.5; margin-right: 0px; margin-bottom: 15px; margin-left: 0px;\">SMAN 1 Anyer telah berdiri sejak tahun 1985. Pada tahun 2003 menjadi sekolah terpadu hingga tahun 2008. Tepatnya pada tanggal 30 Juli 2004 sekolah tersebut di negerikan statusnya oleh pemerintah dengan Surat Keputusan Menteri Agama RI Nomor: 420/KEP/1404-DisPen. Kemudian pada tahun 2017 menjadi RSSN dan berakreditasi A.</p><p style=\"text-align: justify; box-sizing: inherit; line-height: 1.5; margin-right: 0px; margin-bottom: 15px; margin-left: 0px;\">Berdirinya sekolah ini dilatarbelakangi oleh banyaknya lulusan SMPN/MTs yang tidak melanjutkan ke SMA/MA/SMK yang sederajat, di wilayah Kecamatan Anyer ada 2 lembaga pendidikan tingkat SMPN/MTs, sementara tingkat SMA hanya ada 1 lembaga yaitu MA Swasta. Oleh karena itu, muncullah desakan dari para tokoh dan masyarakat Kecamatan Anyer dan sekitarnya agar segera dibangun sekolah SMA Negeri supaya anak-anak lulusan SMP/MTs bisa melanjutkan sekolah lebih tinggi dan bisa menjadi anak-anak yang cerdas.</p><p style=\"text-align: justify; box-sizing: inherit; line-height: 1.5; margin-right: 0px; margin-bottom: 15px; margin-left: 0px;\">SMAN 1 Anyer berdiri karena dorongan oleh rasa tanggung jawab dari para pendirinya. Untuk memenuhi kebutuhan masyarakat di bidang pendidikan yaitu sangat dibutuhkannya lembaga pendidikan yang dapat dijangkau oleh masyarakat tingkat ekonomi ke bawah, yang dapat mendidik anak-anaknya menjadi generasi yang berwawasan tinggi serta memiliki ilmu pengetahuan dan teknologi, maka didirikanlah SMAN 1 Anyer.</p>', NULL, '2021-01-25 16:34:34', '2021-01-25 16:34:34'),
(2, 'Visi & Misi', 'VisiUnggul dalam prestasi akademik plus berkarakter bangsa yang berwawasan lingkungan hidup, berwawasan daerah, nasional dan global berdasarkan iman dan taqwa.Unggul dalam prestasi akademik plus berkarakter bangsaUnggul dalam perolehan hasil Ujian NasionalUnggul dalam perolehan SNMPTN baik di PTN / PTSUnggul dalam penguasaan kecakapan hidup / life skill.Unggul dalam penguasaan&nbsp; TIK dan bahasa asing.Memiliki Tim unggul yang dibina melalui ekskul siap &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;kompetisi dan juara.Berwawasan lingkungan hidup, berwawasan daerah, nasional dan global berdasarkan iman dan taqwa.Tertata lingkungan yang&nbsp; rindang, sejuk dan&nbsp; asri.Unggul dalam disiplinUnggul dalam&nbsp; berperilaku, santun, dan&nbsp; berbudi pekerti luhurUnggul dalam aktivitas keagamaanUnggul dalam kepedulian sosialMisiMeningkatkan&nbsp;&nbsp;&nbsp; profesionalitas&nbsp;&nbsp; kepala&nbsp; sekolah&nbsp;&nbsp; guru dan karyawan dalam rangka meningkatkan pelayanan serta mempersiapkan siswa agar kompetitif di era global.Meningkatkan&nbsp;&nbsp;&nbsp; profesionalisme kepala&nbsp; sekolah, guru, dan karyawanKepala Sekolah memiliki kualifikasi profesionalitasnya yaitu memiliki kompetensi menejerial, kewirausahaan, profesi, kepribadian dan sosialGuru memiliki kualifikasi prefesioanalitasnya yaitu&nbsp; memiliki kompetensi pedagogik, professional, kepribadian dan sosialKaryawan memiliki loyalitas dan dedikasi yang tinggi dalam pekerjaannyaMengoptimalkan disiplin yang tinggiMemacu&nbsp;&nbsp; usaha&nbsp;&nbsp; berkompetisi&nbsp;&nbsp; baik&nbsp;&nbsp; di tingkat lokal, nasional maupun global melalui penguasaan tik dan bahasa asing.Meningkatkan&nbsp;&nbsp;&nbsp;&nbsp; rasa&nbsp;&nbsp;&nbsp; tanggung&nbsp;&nbsp;&nbsp; jawab&nbsp; yang&nbsp;&nbsp; tinggi terhadap tugas dengan penuh kesadaran dengan&nbsp; berperilaku yang baik dan santun.Mengembangkan&nbsp; potensi&nbsp; diriMeningkatkan&nbsp; kualitas dan kuantitas output dan out come melalui peningkatan&nbsp; KBM dan life skill.Menyiapkan&nbsp;&nbsp; infrastruktur&nbsp; sekolah&nbsp; menuju&nbsp; sekolah berdaya saing tinggiMendorong ketaatan beribadah dan toleransi antar sesamaMeningkatkan pelayanan serta mempersiapkan siswa agar kompetitif di era globalMelaksanakan pembelajaran dan bimbingan secara efektif sehingga setiap peserta didik berkembang secara optimal, sesuai dengan potensi yang dimilikiMenumbuhkan semangat keunggulan secara intensif kepada seluruh warga sekolahMendorong dan membantu setiap peserta didik untuk mengenali potensi dirinya sehingga dapat dikembangkan secara optimalMenumbuhkan penghayatan terhadap ajaran agama yang dianut dan budaya bangsa sehingga menjadi sumber kearifan dalam bertindakMelibatkan manajemen partisipatif (MBS) dengan melibatkan seluruh warga sekolah dan kelompok kepentingan yang terkait dengan sekolah', '<h5><span style=\"text-align: center;\"><b>Visi</b></span></h5><p><span style=\"text-align: center;\"><i>Unggul dalam prestasi akademik plus berkarakter bangsa yang berwawasan lingkungan hidup, berwawasan daerah, nasional dan global berdasarkan iman dan taqwa.</i></span></p><h6 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px;\">Unggul dalam prestasi akademik plus berkarakter bangsa</h6><ul style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px 0px 0px 20px; list-style-position: initial; list-style-image: initial;\"><li style=\"box-sizing: inherit;\">Unggul dalam perolehan hasil Ujian Nasional</li><li style=\"box-sizing: inherit;\">Unggul dalam perolehan SNMPTN baik di PTN / PTS</li><li style=\"box-sizing: inherit;\">Unggul dalam penguasaan kecakapan hidup / life skill.</li><li style=\"box-sizing: inherit;\">Unggul dalam penguasaan&nbsp; TIK dan bahasa asing.</li><li style=\"box-sizing: inherit;\">Memiliki Tim unggul yang dibina melalui ekskul siap &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;kompetisi dan juara.</li></ul><h6 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px;\">Berwawasan lingkungan hidup, berwawasan daerah, nasional dan global berdasarkan iman dan taqwa.</h6><ul style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px 0px 0px 20px; list-style-position: initial; list-style-image: initial;\"><li style=\"box-sizing: inherit;\">Tertata lingkungan yang&nbsp; rindang, sejuk dan&nbsp; asri.</li><li style=\"box-sizing: inherit;\">Unggul dalam disiplin</li><li style=\"box-sizing: inherit;\">Unggul dalam&nbsp; berperilaku, santun, dan&nbsp; berbudi pekerti luhur</li><li style=\"box-sizing: inherit;\">Unggul dalam aktivitas keagamaan</li><li style=\"box-sizing: inherit;\">Unggul dalam kepedulian sosial</li></ul><h5 style=\"box-sizing: inherit;\">Misi</h5><p style=\"box-sizing: inherit;\"><span style=\"text-align: center;\"><i>Meningkatkan&nbsp;&nbsp;&nbsp; profesionalitas&nbsp;&nbsp; kepala&nbsp; sekolah&nbsp;&nbsp; guru dan karyawan dalam rangka meningkatkan pelayanan serta mempersiapkan siswa agar kompetitif di era global.</i></span></p><h6 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px;\">Meningkatkan&nbsp;&nbsp;&nbsp; profesionalisme kepala&nbsp; sekolah, guru, dan karyawan</h6><ul style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px 0px 0px 20px; list-style-position: initial; list-style-image: initial;\"><li style=\"box-sizing: inherit;\">Kepala Sekolah memiliki kualifikasi profesionalitasnya yaitu memiliki kompetensi menejerial, kewirausahaan, profesi, kepribadian dan sosial</li><li style=\"box-sizing: inherit;\">Guru memiliki kualifikasi prefesioanalitasnya yaitu&nbsp; memiliki kompetensi pedagogik, professional, kepribadian dan sosial</li><li style=\"box-sizing: inherit;\">Karyawan memiliki loyalitas dan dedikasi yang tinggi dalam pekerjaannya</li><li style=\"box-sizing: inherit;\">Mengoptimalkan disiplin yang tinggi</li><li style=\"box-sizing: inherit;\">Memacu&nbsp;&nbsp; usaha&nbsp;&nbsp; berkompetisi&nbsp;&nbsp; baik&nbsp;&nbsp; di tingkat lokal, nasional maupun global melalui penguasaan tik dan bahasa asing.</li><li style=\"box-sizing: inherit;\">Meningkatkan&nbsp;&nbsp;&nbsp;&nbsp; rasa&nbsp;&nbsp;&nbsp; tanggung&nbsp;&nbsp;&nbsp; jawab&nbsp; yang&nbsp;&nbsp; tinggi terhadap tugas dengan penuh kesadaran dengan&nbsp; berperilaku yang baik dan santun.</li><li style=\"box-sizing: inherit;\">Mengembangkan&nbsp; potensi&nbsp; diri</li><li style=\"box-sizing: inherit;\">Meningkatkan&nbsp; kualitas dan kuantitas output dan out come melalui peningkatan&nbsp; KBM dan life skill.</li><li style=\"box-sizing: inherit;\">Menyiapkan&nbsp;&nbsp; infrastruktur&nbsp; sekolah&nbsp; menuju&nbsp; sekolah berdaya saing tinggi</li><li style=\"box-sizing: inherit;\">Mendorong ketaatan beribadah dan toleransi antar sesama</li></ul><h6 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px;\">Meningkatkan pelayanan serta mempersiapkan siswa agar kompetitif di era global</h6><ul style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px 0px 0px 20px; list-style-position: initial; list-style-image: initial;\"><li style=\"box-sizing: inherit;\">Melaksanakan pembelajaran dan bimbingan secara efektif sehingga setiap peserta didik berkembang secara optimal, sesuai dengan potensi yang dimiliki</li><li style=\"box-sizing: inherit;\">Menumbuhkan semangat keunggulan secara intensif kepada seluruh warga sekolah</li><li style=\"box-sizing: inherit;\">Mendorong dan membantu setiap peserta didik untuk mengenali potensi dirinya sehingga dapat dikembangkan secara optimal</li><li style=\"box-sizing: inherit;\">Menumbuhkan penghayatan terhadap ajaran agama yang dianut dan budaya bangsa sehingga menjadi sumber kearifan dalam bertindak</li><li style=\"box-sizing: inherit;\">Melibatkan manajemen partisipatif (MBS) dengan melibatkan seluruh warga sekolah dan kelompok kepentingan yang terkait dengan sekolah</li></ul><p style=\"box-sizing: inherit;\"><br></p><p><br></p>', NULL, '2021-01-25 16:39:30', '2021-01-25 16:39:30'),
