INSERT INTO `tentangs` (`id`, `sambutan`, `gbrsam`, `ytembed`, `slog`, `updated_at`) VALUES
(1, '<p style=\"text-align: justify; box-sizing: inherit; line-height: 1.5; margin-right: 0px; margin-bottom: 15px; margin-left: 0px;\"><em style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; box-sizing: inherit;\">Assalamualaikum wr.wb.</em></p><p style=\"text-align: justify; box-sizing: inherit; font-size: 16px; line-height: 1.5; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; font-family: &quot;Open Sans&quot;, sans-serif;\">Puji syukur kita panjatkan kehadirat Allah SWT atas segala limpahan rahmat, taufiq dan hidayah-Nya, sehingga kita masih diberi kesempatan untuk berpartisipasi secara aktif dalam dunia pendidikan.&nbsp; Pembuatan website SMA Negeri 1 Anyer ini dimaksudkan untuk memperkenalkan sekolah secara luas kepada masyarakat dan sebagai sarana informasi dan komunikasi antara pihak sekolah dengan siswa, guru, karyawan, alumni dan&nbsp;<em style=\"box-sizing: inherit;\">stakeholders</em>&nbsp;yang memiliki kepedulian, wewenang, dan tanggung jawab dalam memajukan SMAN 1 Anyer. Untuk mewujudkan visi sekolah&nbsp;<em style=\"box-sizing: inherit;\">Unggul dalam prestasi akademik plus berkarakter bangsa yang berwawasan lingkungan hidup, berwawasan daerah, nasional dan global berdasarkan iman dan taqwa.</em></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; line-height: 1.5; text-align: justify; font-size: 16px; font-family: &quot;Open Sans&quot;, sans-serif;\">Pada kesempatan ini, kami ucapkan banyak terima kasih kepada semua pihak yang telah mendukung terbitnya dan berusaha merealisasikan website ini. Selanjutnya website sekolah ini dapat berfungsi sebagai media pembelajaran yang memuat materi maupun tugas yang dibuat oleh guru, &nbsp;sehingga akan menunjang kegiatan pembelajaran berbasis Teknologi Informasi dan Komunikasi. Selain itu, semua kegiatan sekolah intra maupun ekstrakurikuler dapat diunggah melalui website dengan harapan masyarakat luas mengetahui kegiatan dan prestasi dari SMA Negeri 1 Anyer .</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; line-height: 1.5; text-align: justify; font-size: 16px; font-family: &quot;Open Sans&quot;, sans-serif;\">Akhirnya, kami mengucapkan terima kasih atas kunjungan, apresiasi, dan masukan dari semua pihak terhadap website SMA Negeri 1 Anyer.<br style=\"box-sizing: inherit;\"></p><p style=\"text-align: justify; box-sizing: inherit; font-size: 16px; line-height: 1.5; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; font-family: &quot;Open Sans&quot;, sans-serif;\"><em style=\"box-sizing: inherit;\"></em></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; line-height: 1.5; text-align: justify;\"><em style=\"box-sizing: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Wassalamualaikum wr.wb</em></p>', 'kepsekk.jpg', 'LAswuVLMt_I', 'The Best From West', '2021-01-27 19:08:23');
